import styled from 'styled-components';
import imgBackground from '../_imgs/background-ranking-page.png';

const BodySettings = styled.body`
  background-image: url(${imgBackground});
  background-size: cover;
  width: 100vw;
  height: 100vh;

  .logo-Settings {
    position: absolute;
    width: 177.79px;
    height: 189px;
    left: 551.21px;
    top: 53px;
  }
`;

export default BodySettings;
